import React from "react";
import LoadingOverlay from "react-loading-overlay-ts";

function Loading() {
  return (
    <div>
      <LoadingOverlay
        active={true}
        spinner
        text=<p
          style={{
            color: "white",
            backgroundColor: "black",
            width: "400px",
            height: "120px",
            marginTop: "-80px",
          }}
        >
          Please wait...
        </p>
      />
    </div>
  );
}

export default Loading;
